import { NavLink } from "react-router-dom";
import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return (
    <div className="flex max-w-6xl justify-between items-center bg-slate-900 mx-auto ">
      <NavLink to='/'>
        <img src="../shopping-logo.png" className="h-14"/>
      </NavLink>
      <div>
        <NavLink to='/'>
          <div>Home</div>
        </NavLink> 

        <NavLink to='/'>
          <div><FaShoppingCart /></div>
        </NavLink>
      </div>
    </div>
  );
};

export default Navbar;
